import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Check if cart is empty by looking at cart count
    const cartCount = await page.$eval('.cart', el => parseInt(el.textContent.trim()));

    if (cartCount === 0) {
      // Add an item to cart first since we need something to remove
      await page.waitForSelector('.product-card', { timeout: 5000 });
      await page.click('.product-card:first-child .add-to-cart');

      // Wait for cart to update
      await page.waitForFunction(() => {
        const cartText = document.querySelector('.cart').textContent;
        return parseInt(cartText) > 0;
      }, { timeout: 5000 });

      await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
      screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));
    }

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { timeout: 5000, state: 'visible' });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // Remove item from cart
    await page.click('.remove-item');

    // Wait for cart to update and show empty message
    await page.waitForSelector('.empty-cart', { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_item_removed.png'));

    // Close cart modal
    await page.click('.close');
    await page.waitForSelector('#cartModal', { timeout: 5000, state: 'hidden' });

    // Verify cart is empty
    const finalCartCount = await page.$eval('.cart', el => parseInt(el.textContent.trim()));

    return {
      success: true,
      action: "Successfully removed item from cart",
      extractedData: {
        initialCartCount: cartCount,
        finalCartCount: finalCartCount,
        itemRemoved: finalCartCount < cartCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
